import React from 'react';
import './Home.scss'
import bg from '../../images/bg.svg'


const Home = () => {
    return(
        <div className = "marketing" style = {bg}>
            <div className = "marketing-grid">
                <div className = "statement">
                    <h1>One Stop Shop For All Your Cloud Needs.</h1>
                    <p>With modern technology and major events leading to the remote interaction of employees and clients alike, the push to migrate to the cloud are larger than ever before. With security, reliable data movement, and positive customer experience all critical, ScaleHaus is ready to jump start your company in all of your cloud and delivery needs.</p>
                </div>
            </div>
        </div>
    )
}

export default Home;
